import { colors, createTheme, ThemeProvider } from "@mui/material";

const getDesignTokens = mode => ({
  palette: {
    mode, 
    ...(mode === "light" ? {
      secondary: {
        main: colors.green[400]
      }  
    } : {
      secondary: {
        main: colors.green[800]
      }
    })
  }
});

const theme = createTheme({
  palette: {
    mode: "light",
    secondary: {
      main: colors.green[800]
    }
  }
});

export default theme;
